import {
    MapContainer,
    TileLayer,
  } from 'react-leaflet'
import axios from 'axios'
import React, { useState, useEffect } from 'react';

export default function Map() {
    const [base, setBase] = useState(null);
    const [county, setCounty] = useState(null);
    const [state, setState] = useState(null);

    useEffect(() => {
        axios.get("http://localhost:5000/map").then((res) => {
            setBase(res.data.image);
            setCounty(res.data.county);
            setCounty(res.data.state);
         })
      }, []);


    return (
        <MapContainer style={{backgroundColor: "black",height: "75vh", width: "60vw"}} center={{lat: 35.938, lng:-79.81}} zoom={10}>
            {base ?
             <TileLayer
                url={base}
            /> : null}
            {county ?
             <TileLayer
                url={county}
            /> : null}
            {county ?
             <TileLayer
                url={county}
            /> : null}
        </MapContainer>
    )
}
